import './MapStyle.css'
import React from "react";
import Map from 'ol/Map'
import {View} from "ol";

function BaseMap() {

    const map = new Map({
        target: 'map',
        view: new View({
            center: [0, 0],
            zoom: 0,
            minZoom: 18,
            maxZoom: 2,
        })
    });

    return (
        <div id="map"></div>

    )
}

export default BaseMap;
